script: |
  super -f text -I q10947.spq | sort > q10947.out

inputs:
  - name: q10947.spq
    data: |
      SELECT ALL - + 66 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT ( - - col0 + 46 * - col0 + + + col2 ) BETWEEN - col1 AND + + col1 + col0;
  - name: tab2

outputs:
  - name: q10947.out
    data: |
      -66
      -66
      -66
